import styled from "styled-components";

const StyleComponentsPhone = styled.div`
  background-color: #fafafa;
  width: 330px;
  height: 680px;
  border-radius: 48px;
  display: flex;
  justify-content: center;
  align-items: center;
  font-size: 1em;

  img {
    border-radius: 48px;
    width: 300px;
    height: 650px;
    background-repeat: no-repeat;
    background-size: contain;
  }
  box-shadow: rgb(0 0 0 / 18%) 0px 13px 24px 0px,
    rgb(0 0 0 / 8%) 0px -6px 9px 0px inset;
`;

const StylePhoneFrame = styled.div`
  background-color: #fafafa;
  /* background-color: aquamarine; */
  width: 162px;
  height: 38px;
  border-radius: 18px;
  position: absolute;
  right: 80px;
  top: 192px;
`;
const SubLayer = styled.div`
  height: 800px;
  width: 330px;
  align-items: center;
  /* background-color: bisque; */
`;

function Phone() {
  return (
    <SubLayer>
      <StyleComponentsPhone>
        <StylePhoneFrame>
          <img src="./img/img_01_screen.png" alt="main_phone_img" />
        </StylePhoneFrame>
      </StyleComponentsPhone>
    </SubLayer>
  );
}

export default Phone;
